(print trans-mean-yeom trans-mean-hong)

(defquery inference-fin [probs trans]
  (loop [result '()
         ps probs]
    (if (empty? ps)
      result
      (let [p-con (* (first ps) trans)
            is-con (if (sample (flip p-con)) 1 0)]
        (recur (cons is-con result)
               (rest ps))))))

(defquery inference-fin22 [probs trans]
  (loop [result '()
         ps probs]
    (if (empty? ps)
      result
      (let [p-con (* (first ps) trans)
            is-con (if (sample (flip p-con)) 1 0)]
        (recur (cons is-con result)
               (rest ps))))))

(def final-result-hong
    (first
      (map :result
         (take 1 (take-nth
                   50 (drop 5000 (doquery
                                   :ipmcmc
                                   inference-fin
                                   [probs-hong trans-mean-hong])))))))
(def final-result-yeom
    (first
      (map :result
         (take 1 (take-nth
                   50 (drop 5000 (doquery
                                   :ipmcmc
                                   inference-fin22
                                   [probs-yeom trans-mean-yeom])))))))
