(def yeom-points (filter (fn [x] (not (= (first x) "홍문종"))) (map vector mem-except-yeom probs-yeom)))
(def hong-points (filter (fn [x] (not (= (first x) "염동열"))) (map vector mem-except-hong probs-hong)))

(def scatter-points
  (map (fn [entry] [[(second (first entry)) (second (second entry))]  ; x: 홍문종, y: 염동열, z: 소속정당
                    (second (nth party-info (index-of (first (first entry)) members)))])
    (map vector hong-points yeom-points)))
(def plots
  (map
    (fn [x] (plot/list-plot [(first x)] :color ((keyword (second x)) color-map)
                            :plot-range [[0.25 0.7] [0.25 0.7]] :symbol-size 10 :opacity 0.65))
      scatter-points))

(apply plot/compose plots)
